import React from "react";
import SingleListItem from "./singleListItem";

const TodoList = ({todos, setTodos}) => {

    return (
            <div>
                {todos.map(todo => {
                    // return <SingleListItem todo = {todo} setTodos={setTodos} todos = {todos}/>;
                    <li
                        className="list-item"
                        key={todo.id}
                    >
                        <div
                            className="list"
                        >
                            {todo.title}
                        </div>

                    </li>
                })}
            </div> 
        
    );
};

export default TodoList
